def score(verteilung, wünsche):
    scores = [0, 0, 0]
    for player, present in verteilung.items():
        player_wünsche = wünsche[player]
        if present in player_wünsche:
            scores[player_wünsche.index(present)] += 1
    return scores


def check(verteilung, wünsche):
    check_score = score(verteilung, wünsche)
    print(check_score)
    first_wishes = [wish[0] for wish in wünsche.values()]
    print(first_wishes)
    n_trivial_first = len(set(first_wishes))
    print(set(first_wishes))
    print(n_trivial_first)
